import React from 'react';

import { CustomButtonContainer,GoogleLogin,Invented} from './custom-button.style';

const CustomButton =({children, isGoogleSignIn,inverted, ...otherProps})=>(

        isGoogleSignIn ? (<GoogleLogin>{children}</GoogleLogin>):
        Invented ? (<Invented>{children}</Invented>):(<CustomButtonContainer>{children}</CustomButtonContainer>)

)

export default CustomButton;
